import React from 'react';
import "../../Css/Project.css"

const Project = ({project, auth}) => (
  <div classname="project" >
      
     {/* {project.map(projectData => project._id === auth.user( */}
     {project.filter(project => project._id === auth.user).map(filteredProject => (

            <div  className="projectBody" key={filteredProject._id}>
                  <h4 className="projectTitle">{filteredProject.projectTitle}</h4>
                  <h4 className="projectDescription">{filteredProject.projectDescription}</h4>
                  <ul className="projectSkills">{filteredProject.projectSkills.map(skills => (
                     <li>{skills}</li> 
                 ))}
                 </ul>
                  <h4 className="projectBudget">Rs. {filteredProject.projectBudget}</h4> 
                  <h4 className="applyBtn">Apply</h4>           

            </div>
         ))}
  </div>
);


export default Project;
